version = "0.1.0"
source = { virtual = "." }
dependencies = [
    { name = "boto3" },
    { name = "py-ocsf-models" },
    { name = "pydantic" },
    { name = "regex" },
    { name = "types-boto3", extra = ["bedrock-runtime", "dynamodb", "s3", "stepfunctions"] },
]

[package.dev-dependencies]
dev = [
    { name = "moto" },
    { name = "pytest" },
]

[package.metadata]
requires-dist = [
    { name = "boto3", specifier = ">=1.37.5" },
    { name = "py-ocsf-models" },
    { name = "pydantic", specifier = ">=1.10.15" },
    { name = "regex", specifier = ">=2024.11.6" },
    { name = "types-boto3", extras = ["bedrock-runtime", "dynamodb", "s3", "stepfunctions"], specifier = ">=1.37.5" },
]

[package.metadata.requires-dev]
dev = [
    { name = "moto", specifier = ">=5.1.1" },
    { name = "pytest", specifier = ">=8.3.5" },
]

